import React from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './style.css';
import About from "./pages/About";
import Contact from "./pages/Contact";
import Portfolio from "./pages/Portfolio";
import Skills from "./pages/Skills";
import NewLanding from "./pages/NewLanding";
import Sidebar from "./components/Sidebar";

function App() {
  return (
    <Router>
    <React.Fragment>
    <Route component={Sidebar} />
      <Switch>
      <Route exact path="/" component={NewLanding, Sidebar} />
      <Route exact path="/About" component={About, Sidebar} />
      <Route exact path="/Portfolio" component={Portfolio, Sidebar} />
      <Route exact path="/Skills" component={Skills, Sidebar} />
      <Route exact path="/Contact" component={Contact, Sidebar} />
      </Switch>
      </React.Fragment>
  </Router>
  );
}

export default App;
